import React from 'react';

const Jumbotron = () => {
    return (
        <div className="jumbotron">
            <div className="jumbotron-cover-image"></div>
            <div className="jumbotron-cover-legend">Test</div>
            <div className="jumbotron-cover-overlay"></div>
        </div>
    );
};

export default Jumbotron;
